mutation deleteOneProduct ($id: String) {
    deleteOneProduct (id: $id) {
        _id
        tariffName
        description
        month
        values {
            baseCost
            kwhCost
            maxConsumption
        }
    }
}

mutation deleteFilesToProcess ($ids: [String]) {
    deleteFilesToProcess (ids: $ids) {
        Deleted {
            Key
            VersionId
        }
    }
}

mutation deleteCalculations ($ids: [String]) {
    deleteCalculations (ids: $ids) {
        n
        ok
        deletedCount
    }
}

query listAllProduct {
    listAllProduct {
        _id
        tariffName
        description
        month
        values {
            baseCost
            kwhCost
            maxConsumption
        }
    }
}

query listAllCalculationCost {
    listAllCalculationCost {
        _id
        person {
            firstName
            lastName
        }
        dateProcessed
        installNumber
        totalCosts {
            kwhYear
            products {
                name
                description
                charger
                totalYear {
                    baseCostsYear
                    kwhCostsYear
                    totalCosts
                }
            }
        }
    }
}

query calculateCostYear ($kwhYear: String) {
    calculateCostYear (kwhYear: $kwhYear) {
        kwhYear
        products {
            name
            description
            charger
            totalYear {
                baseCostsYear
                kwhCostsYear
                totalCosts
            }
        }
    }
}
